        // history.push('/');
      }
    })
    .catch(err => console.log(err));
}

function App() {
  return (
    <>
      <Header />
      <Switch>
        <Route exact path="/">
          <Main />
        </Route>
        <Route path="/signin">
          <Login onLogin={onLogin} />
        </Route>
        <Route path="/view">
          <View />
        </Route>
      </Switch>
    </>
  );
}

export default App;
